import '../css/Navigation.css';

const TopBar = () => {
    const navigation = [
        {
            label: 'Tela Inicial',
            icon: <ion-icon name="home-outline"></ion-icon>,
            subitens: null,
        },
        {
            label: 'Calculadora',
            icon: <ion-icon name="calculator-outline"></ion-icon>,
            subitens: [
                { label: 'Macro Nutrientes' },
                { label: 'Correção de Acidez' },
                { label: 'Micro Nutrientes' },
            ],
        },
        {
            label: 'Cotações',
            icon: <div className='money-icon'>$</div>,
            subitens: null,
        },
        {
            label: 'Loja',
            icon: <ion-icon name="storefront-outline"></ion-icon>,
            subitens: null,
        }
    ]




    return (
        <div class="top-container">

            <header class="menu-superior">
                <h1>Insumos Agropecuários</h1>
            </header>


            <nav class="navegacao">
                <ul>
                    {navigation.map((item, key) => {

                        if (item.subitens === null) {
                            return (
                                <li key={key} id={key} className='navigation-item'>{item.icon} {item}</li>
                            )
                        }
                    })}
                </ul>
            </nav>

        </div>
    );
}

export default TopBar;
